import React,{useState} from 'react';
import Data from './Data';
import Header from './Header';
import './Shopping_css.css';

function Main1(){
	const [data1,setdata1]=useState(Data);
	return(
	<>
	<Header/>
	{data1.map((item=>{
		return(
		<>
		<div class="card">
		<img key={item.id} src={item.img} className="img2"/>
	    <div class="card-body">
		<h5 key={item.id} class="card-title">{item.title}</h5>
		<p key={item.id} class="card-text">{item.price}</p>
		<a href="#" class="btn btn-primary">ADD TO CART</a>
		</div>
		</div>

		</>
		);
	}))}

	</>
	);
}

export default Main1;
